            <span>Username</span>
            <h3>Заголовок</h3>
            <p>Текст</p><hr />
            <img src="https://clipart-best.com/img/like/like-clip-art-17.png" className={c.Like1} />
            <span>13</span>
            <img src="https://clipart-best.com/img/dislike/dislike-clip-art-22.png" className={c.Like1} />
            <span>2</span>
        </div>
    );
}

export default Post;
